    "valley-city-wetland-management-district-annual-narrative-report-calendar-year-1982",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Valley
    City WMD, Hobart Lake NWR, Sibley Lake NWR, Stoney Slough NWR, and Tomahawk NWR
    outlines Refuge accomplishments during the 1982 calendar year. The report begins
    with a summary of the year's highlights and weather conditions. Land acquisition
    is covered. Refuge administration is outlined; information about personnel, funding,
    safety, and technical assistance is given. Habitat management is also covered; subjects
    include wetlands, croplands, grasslands, grazing, haying, fire management, pest
    control, water rights, and WPA easements. The wildlife section of the report discusses
    wildlife diversity, endangered and threatened species, waterfowl, marsh birds and
    waterbirds, shorebirds, raptors, game mammals, wildlife propagation, scientific
    collections, animal control, and marking and bird banding. The public uses of the
    Refuge described in this report include outdoor classrooms, interpretive programs,
    hunting, trapping, wildlife observation, outdoor recreation, and law enforcement.
    The equipment and facilities section of the report provides information about new
    construction, rehabilitation, equipment replacement, and communication systems.
    Cooperative programs and items of interest are provided at the end. Newspaper articles
    are attached.",nt"license_title": "License Not Specified",nt"extras":
